dedicatedCyclewaysQuery:
  [out:json];
rel(16918862);map_to_area->.region;
(
  way(area.region)["highway"~"cycleway"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"]["segregated"!="no"]["foot"!~"designated|yes"]["access"!="no"];

  way(area.region)["cycleway"="track"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];
  way(area.region)["cycleway:right"="track"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];
  way(area.region)["cycleway:left"="track"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];
  way(area.region)["cycleway:both"="track"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];

  // No longer includes painted lanes with painted buffer space (but no physical separator)
  // Eg: 110kph Princes Motorway and only paint: https://www.openstreetmap.org/way/5067683

  // Include painted lane ONLY if there is some sort of physical separator
  // These might include car parking/bollards/flex posts/bumps/planters etc
  // See https://wiki.openstreetmap.org/wiki/Key:cycleway:separation

  way(area.region)["cycleway"="lane"]["cycleway:separation"]["cycleway:separation"!~"^(no|solid_line|dashed_line|)$"];
  way(area.region)["cycleway:left"="lane"]["cycleway:left:separation"]["cycleway:right:separation"!~"^(no|solid_line|dashed_line|)$"];
  way(area.region)["cycleway:right"="lane"]["cycleway:right:separation"]["cycleway:right:separation"!~"^(no|solid_line|dashed_line|)$"];
  way(area.region)["cycleway:both"="lane"]["cycleway:both:separation"]["cycleway:both:separation"!~"^(no|solid_line|dashed_line|)$"];
);
out geom;

onRoadCycleLanesQuery:
[out:json];
rel(16918862);map_to_area->.region;
(
  way(area.region)["cycleway"="lane"];
  way(area.region)["cycleway:left"="lane"];
  way(area.region)["cycleway:right"="lane"];
  way(area.region)["cycleway:both"="lane"];
);
out geom;

sharedPathsQuery:
[out:json];
rel(16918862);map_to_area->.region;
(
  // Exclude footpath cycling for equal comparisons across states, though you could argue
  // a legal cycling footpath is as valid as a shared path. I've added a note in the copy text that
  // footpath cycling is excluded for clarity.

  // Not all footpaths in legal juristictions are tagged with bicycle=yes as well so this would be
  // incomplete.

  // There may be false negatives here, but footpaths that allow cycling and aren't a shared path
  // are very rare (and are likely tagging errors) in non-footpath cycling states.
  // way(area.region)["highway"="footway"]["bicycle"="yes"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];

  // Include shared paths
  way(area.region)["highway"="cycleway"]["segregated"="no"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];
  way(area.region)["highway"="cycleway"][!"segregated"]["foot"~"yes|designated"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];

  // Include pedestrian streets tagged as explicitly allowing cycling (eg. Martin Place)
  way(area.region)["highway"="pedestrian"]["bicycle"="yes"]["surface"!~"^(dirt|gravel|unpaved|ground|compacted|fine_gravel|shells|rock|pebblestone|earth|grass|sand)$"];
);
out geom;

